import React, { Component } from "react";
import ReactDOM from "react-dom";

const Overview = (props) => {
    const { tasks } = props;

    return (
      <ul>
        {tasks.map((task) => {
          return <li>{task}</li>;
        })}
      </ul>
    );
  };

  export default Overview;
